Sure! Here's a simple JavaScript function that swaps the positions of adjacent words in a sentence, effectively reversing the order of adjectives:

```js
function reverseAdjectives(sentence) {
  // Split the string into an array of words
  const words = sentence.split(" ");

  // Reverse the order of adjacent elements (i.e., swap adjectives)
  for (let i = 0; i < words.length - 1; i++) {
    [words[i], words[i + 1]] = [words[i + 1], words[i]];
  }

  // Join the words back into a string
  return words.join(" ");
}

// Example usage
const originalSentence = "Beautiful green trees are in the park";
const reversedSentence = reverseAdjectives(originalSentence);
console.log(reversedSentence);
// Output: "Green beautiful trees are in the park"
```

The `reverseAdjectives()` function first splits the input sentence into an array of words using the `split()` method. It then iterates over the array from the beginning to the second-to-last element, swapping the positions of adjacent elements at each iteration using destructuring assignment. Finally, it joins the modified array back into a single string using the `join()` method and returns the result.

