```swift
let homophones = [
    ("there", "they're", "their"),
    ("your", "you're"),
    ("to", "too", "two"),
    ("then", "than"),
    ("principal", "principle"),
    ("stationery", "stationary"),
    ("discreet", "discrete"),
    ("complement", "compliment"),
    ("counsel", "counselor"),
    ("effect", "affect")
]

func replaceHomophones(text: String) -> String {
    var result = ""
    let words = text.components(separatedBy: .whitespacesAndNewlines)
    for word in words {
        for (correct, incorrect, _) in homophones {
            if word == incorrect || word.hasPrefix(incorrect + " ") {
                result += correct
                result += " "
                break
            }
        }
        result += "\(word) "
    }
    return String(result.prefix(result.indices.last!))
}

