function getMatches(object, path) {
  let result = [];
  let current = object;
  const keys = path.split(".");

  for (let I = 0; I < keys.length - 1; i++) {
    if (!current[keys[i]]) {
      return result; // early exit if we reach a missing key
    }
    current = current[keys[i]];
  }

  const lastKey = keys[keys.length - 1];
  for (const value of Object.values(current[lastKey])) {
    result.push({ [path]: value });
  }
  return result;
}

