@Injectable()
export class EnvCheckMiddleware implements NestMiddleware {
  use(context: ExecutionContext): Observable<any> | Promise<any> | any {
    const req = context.switchToHttp().getRequest();
    const env = process.env.NODE_ENV;

    if (env === 'production') {
      return super.use.call(this, context); // Call the next middleware or controller function
    }

