```typescript
import React from 'react';
import { Downshift } from 'react-downshift';
import { useSearchEmails } from './search-emails';

function EmailAutocomplete() {
  const { results, isLoading, isError } = useSearchEmails();

  return (
    <Downshift itemKey={email => email} defaultSelectedItem={null}>
      {({
        getInputProps,
        getItemProps,
        getMenuProps,
        isOpen,
        selectedItem,
        highlightedIndex,
      }) => (
        <div>
          <label htmlFor="email-input">Enter email:</label>
          <input
            type="text"
            id="email-input"
            {...getInputProps({
              placeholder: 'Type an email address...',
            })}
          />
          {isLoading && <p>Loading...</p>}
          {isError && <p>Error loading emails.</p>}
          {!isLoading && !isError && (
            <ul {...getMenuProps()} style={{ maxHeight: 200 }} tabIndex="-1">
              {results.map((email, index) => (
                <li
                  key={email}
                  {...getItemProps({
                    key: email,
                    index,
                    selected: selectedItem === email,
                    highlighted: index === highlightedIndex,
                  })}
                >
                  {email}
                </li>
              ))}
            </ul>
          )}
        </div>
      )}
    </Downshift>
  );
}

export default EmailAutocomplete;
```

