  while (planets.length < numPlanets && attempts < 100) {
    attempts++;

    let hasCollision = false;

    // Generate initial planet position
    const position = [
      randomPosition(-30, 30),
      randomPosition(-30, 30),
      randomPosition(-30, 30),
