    if (!hasCollision) {
      const planet = {
        position,
        size: randomSize(1, 5) * scale,
        color: randomColor(),
        ringSize: 0.2 * scale,
        ringColor: randomColor(),
        ringNoise: 0.3 * scale,
      };

      planets.push(planet);
    }
  }

  return planets;
};
```

