class ChatRoom implements MessageComponentInterface {
    protected $clients = [];

    public function __construct() {}

    public function onOpen(ConnectionInterface $conn) {
        // Add the new connection to the list of connected clients
        $this->clients[$conn] = $conn;
        echo "New connection! (" . Count($this->clients) . ")\n";
    }

    public function onMessage(ConnectionInterface $from, $msg) {
        // Broadcast the message received from one client to all other connected clients
        foreach ($this->clients as $client) {
            if ($client !== $from) {
                $client->send($msg);
            }
        }
    }

    public function onClose(ConnectionInterface $conn) {
        // Remove the disconnected client from the list of connected clients
        unset($this->clients[$conn]);
        echo "Connection closed: (" . Count($this->clients) . ")\n";
    }

    public function onError(ConnectionInterface $conn, \Exception $e) {
        echo "An error occurred: {$e->getMessage()}\n";
        $conn->close();
    }
}

