Sure, here's an implementation of binary search in C++:

```cpp
int binarySearch(int arr[], int left, int right, int x) {
    while (left <= right) {
        int mid = left + (right - left) / 2;

        // Check if x is present at mid
        if (arr[mid] == x)
            return mid;

        // If x greater, ignore left half
        if (arr[mid] < x)
            left = mid + 1;

        // If x is smaller, ignore right half
        else
            right = mid - 1;
    }

    // if we reach here, then element was not present
    return -1;
}
```

This function takes an integer array `arr`, initial indices `left` and `right`, and the value `x` being searched for as arguments. It returns the index of `x` if found, or `-1`. The algorithm works by repeatedly dividing the search interval in half until the target is found or the intervals no longer overlap.

Some lesser-known facts about binary search:

- Binary search has a time complexity of O(log n), which makes it very efficient compared to linear search (O(n)). This means that as the size of the input grows, binary search becomes much faster than linear search.
- However, binary search only works on sorted arrays. If the array is unsorted, you'll need to sort it first before searching.
- Binary search can be easily optimized using recursion, but this can lead to stack overflow errors due to excessive function calls. The iterative version shown above avoids this issue.
- Another optimization is to store the midpoint index from the previous iteration, rather than recalculating it each time. This reduces the number of arithmetic operations needed and improves performance.
- Binary search can also be used in conjunction with other algorithms, such as merge sort, to efficiently perform tasks like finding the kth smallest element or calculating the median of a list.

