Function GetFolderACLs($folderPath) {
    $acl = Get-Acl $folderPath
    foreach ($subFolder in Get-ChildItem $folderPath -Recurse | Where-Object {$_.PSIsContainer}) {
        $subAcl = Get-Acl $subFolder.FullName
        $combinedAcl = New-Object System.Security.AccessControl.DirectorySecurity()
        $combinedAcl.SetAccessRule($acl.Access | Add-AccessRule $subAcl.Access)
        Set-Acl $subFolder.FullName $combinedAcl
    }
    return $acl
}

# Main script
Get-ChildItem C:\MyFolder -Recurse | Where-Object {$_.PSIsContainer} | ForEach-Object {
    $folderPath = $_.FullName
    $acl = GetFolderACLs $folderPath

    # Filter out access rules that reference SIDs found only in SIDHistory
    $filteredAcl = $acl.Access | Where-Object {
        $sid = $_.IdentityReference.Value
        !CheckSidInSidHistory $sid
    }

    # Set new filtered ACL
    Set-Acl $folderPath $filteredAcl
}
